  .html5tooltip-box {
    background-color:#113C25;
    border-radius:2px;
    box-shadow:0 0 0 1px rgba(255,255,255,.15),0 0 10px rgba(255,255,255,.15);
    color:#FFFFFF;
    font-family: 'Baskerville Display PT', auto;
    font-style: italic;
    font-size:65%;
    font-weight:700;
    font-style: italic; 
  }
  .html5tooltip-arrow {
      position: absolute;
      top: -6px;
      left: 12px;
      width: 0;
      height: 0;
      border-left: 6px solid transparent;
      border-right: 6px solid transparent;
      border-bottom: 6px solid #113c25;
    }
  .html5tooltip-more,.html5tooltip-text {
    background-color:inherit;
    border-radius:inherit;
    position:relative
  }
  .html5tooltip-text {
    color:inherit;
    font-family:inherit;
    font-size:inherit;
    font-weight:inherit;
    padding:7px 9px
  }

  .scalein-from { 
    opacity:0;
    -moz-transform:scale3d(.7,.7,.7);

    -webkit-transform:scale3d(.7,.7,.7);
    transform:scale3d(.7,.7,.7)
  }
  .scalein-to {
    opacity:1;
    -moz-transform:scale3d(1,1,1);
    -ms-transform:scale3d(1,1,1);
    -o-transform:scale3d(1,1,1);

<style>
* { -moz-box-sizing: border-box; box-sizing: border-box; }
body, html { height: 100%; }
body
{
  background-color:#383838;
  color: white;
  margin: 0;
  font-size: 2vmin;
}
.container {
  max-width: 1500px;
  margin: 0;
}
.grid {
  display: grid;
  grid-template-columns: repeat(4, 1fr);
}
a{outline:none}
input {
    font-size: 2vmin;
    position: relative;
    height: 100%;
    width: 100%;
    background: transparent;
    border-width: 0 0 0.5px 0;
    border-style: none none solid none;
    border-color: transparent transparent #113c25 transparent;
    font-size: 1.2em;
    color: #113c25;
    padding: 1.3% 0.5%;
    font-family: 'Baskerville Display PT', auto;
    font-style: italic;
}
  
.clearboth { display: block; clear: both; }

.section {
  opacity: 1;
  height: inherit;
  display: flex;
  flex-direction: column; 
  transition: opacity 900ms ease-in-out;
}
.section.hide { opacity: 0; }
.section.final { display: none; }

.section.c2 { background-color: #383838; background-image: url(images/songketbg2.png); background-size: cover; background-position: center 50%; padding-bottom: 1.5vh; overflow: hidden !important; position: relative; }
.section.c3 { background-color: #F7F7F7; background-image: url(images/songketbg2.png); background-size: cover; background-position: center 50%; padding: 2% 3%; font-size: 2vmin;}
.section.c4 { background-color: #E39B7D; }
.section.c5 { background-color: #E6E4DD; }
.section.c6 { display: flex; flex-direction: column; background-color: #383838; background-image: url(images/batikbg.png); background-attachment: fixed; background-size: cover; background-position: center 50%;}

.section.i1,
.section.i2,
.section.i3,
.section.i4
{
  background-size: cover;
  background-position: center;
  
}
.section.i1
{
  border:0;
  align-items:center;
  justify-content:center;
  overflow:hidden;
}
.section.i2
{
  border: 0; 
  width: 100%; 
  align-items: center; 
  justify-content: center; 
  position: relative; 
  overflow: hidden;
}
.section.c2, .section.c3
{
  border:0;
  align-items:center;
  justify-content:center;
  gap: 2vh;
  font-family: 'The Seasons', auto;
}

.section.c5
{
  padding:3% 2%; 
  height: auto;
  align-items:center; 
  gap:5vmin;
}
  
.section.i1 { background-image: url(images/BG11.jpg); }
.section.i2 { background-image: url(images/BG62.jpg); }
.section.i3 { background-image: url(images/BG7.jpg); }
.section.i4 { background-image: url(images/ZK-164.jpg); }

.full-height { height: 100%; }
.height-80 { height: 90%; }

#LogoContainer
{
  position: relative;
  aspect-ratio: 0.717;
  max-width: 85%;
  height: 70%;
}
#plyrContainer
{
  position:absolute;
  bottom:2.5%;
  right:2%;
  max-width: 55%;
  aspect-ratio:1;
  display:flex;
  justify-content:flex-end;
  border-radius:8px;
  overflow:visible;
  background-color:transparent;
}

#note-parent
{
  position:relative; 
  transform: scale(0.95);
  -ms-transform: scale(0.95);
  -moz-transform: scale(0.95);
  -webkit-transform: scale(0.95);
  margin-top: 3vmin; 
  transform-origin: center top;
  max-width:85%;
  display:flex;
  align-items: center;
  justify-content:center;
}

#note-container
{
  position: absolute; 
  top: 17%; 
  bottom: 5%;
  display: flex; 
  flex-direction: column; 
  justify-content: space-around; 
  align-items: center; 
  text-align: center; 
  background: transparent; 
  box-sizing: border-box;
  z-index: 1; 
  transform: rotate(-2.7deg);
  -ms-transform: rotate(-2.7deg);
  -moz-transform: rotate(-2.7deg);
  -webkit-transform: rotate(-2.7deg);
  transform-origin: center top;
  font-size: 1.7vmin;
  font-family: 'Times New Roman', auto;
}

#end-page-container
{
  width:90%; 
  display:flex; 
  flex-direction:column; 
  align-items:center;
  text-align:center;
  font-family:'The Seasons', auto;
  font-size:2vmin;
}

#countdown-container
{
  width:90%; 
  color:#113c25; 
  font-family:'Pinyon Script',cursive; 
  margin-bottom:1.5vmin;
}
.countdownBox { display:flex; justify-content:space-between; width:100%; color:#113C25; }

.SpaceDays, .SpaceHours, .SpaceMinutes, .SpaceSeconds { display:flex; flex-direction:column; flex:1; min-width:10%; }

.LabelDays, .LabelHours, .LabelMinutes, .LabelSeconds { font-size:1.2em; opacity:0.9; margin-bottom: 0.5em; }

.D-Day { display:none; font-size:1.4em; color:#113C25; }

#SpanDays, #SpanHours, #SpanMinutes, #SpanSeconds { font-size:1.3em; font-weight:bold; line-height:1; margin-top:0.5em; }

#EndNoteText { width:100%; text-align:center; display:flex; flex-direction:column; justify-content:center; color: #113c25; }

.ThanksText { font-family:'Six Hands Chalk',auto; margin:0; font-size:2em; font-weight:400; margin-bottom: 0.5em; font-style:normal; transform:rotate(-8.2deg); }

.ShoutoutText { font-family:'Baskerville Display PT',auto; margin:0; font-size:1em; font-weight:400; margin-bottom: 0.5em; font-style:italic; text-align:center; }

.WithLove { align-items:flex-start; font-family:'New Icon Script',auto; margin:0; margin-top:2vmin; font-size:1.1em; font-weight:400; font-style:normal; text-align:center; } 
.InviteText { font-family:'Baskerville Display PT',auto; margin:0; font-size:200%; margin-bottom: 0.3em; font-style:normal; text-align:center; color:#113C25; }

@media (max-width: 1200px) {
  #note-container {
    font-size: 1.5vmin;
  }

  #end-page-container {
    font-size: 1.8vmin;
  }
  .grid {
    grid-template-columns: repeat(3, 1fr);
  }
}

@media (max-width: 992px) {
  #LogoContainer {
    max-width: 75%;
    height: auto;
  }

  #note-container {
    font-size: 1.4vmin;
    padding: 1rem;
  }

  .section.c3 {
    padding: 2% 4%;
    font-size: 2.1vmin;
  }
  .grid {
    grid-template-columns: repeat(2, 1fr);
  }
}

@media (max-width: 600px) {
  body {
    font-size: 3.5vmin;
  }
  
  #LogoContainer {
    max-width: 70%;
    height: auto;
  }

  #note-container {
    font-size: 2.2vmin;
  }

  #end-page-container {
    font-size: 3vmin;
    width: 100%;
  }

  .countdownBox {
    flex-direction: column;
    gap: 0.8rem;
  }

  .SpaceDays, .SpaceHours, .SpaceMinutes, .SpaceSeconds {
    min-width: auto;
  }
  .grid {
    grid-template-columns: repeat(1, 1fr);
  }
}
</style>
<style>
    @font-face {
        font-family: 'Baskerville Display PT';

  <body>
    <div class="section c3">
  <style>
    #InviteContainer {
      position:relative; 
      transform: scale(0.8);
      -ms-transform: scale(0.8);
      -moz-transform: scale(0.8);
      -webkit-transform: scale(0.8);
      align-items:center;
      max-width:85%;
      display:flex;
      opacity: 0; 
      transition: opacity 1000ms ease-in-out;
      justify-content: space-between;
      flex-direction: column;
    }
    #DetailsContainer {
      padding: 2%;
      position: absolute;
      display:flex;
      flex-direction: column;
      justify-content: space-between;
      align-items: center;
      background: transparent;
      z-index: 1;
    }
    .InvText {
      font-family: 'The Seasons', auto;
      color: #113c25;
      text-align: center;
      font-size: 150%;
      margin: 0;
    }
    .invite {
      object-fit:contain; 
      width: 65%;
      z-index: -1;
    }
    .visible { opacity: 1; }
  </style>

  <div id="InviteContainer">
    <img id="paper" src="images/blankpaperportrait.png" class="invite">
    <div id="DetailsContainer">
      <p class="InvText">You're invited!</p>
      <p class="InvText">to the wedding of Adibah &amp; Abby!</p>
    </div>
  </div>
  
  <script>
      document.addEventListener('DOMContentLoaded', function() {
        const images = document.querySelectorAll('.section.c3 background-image, .section.c3 img');
        let loadedImages = 0;
    
        function checkImagesLoaded() {
          loadedImages++;
          if (loadedImages === images.length) {
            document.getElementById('InviteContainer').style.opacity = "1";
          }
        }
        
        images.forEach(function(img) {
          img.addEventListener('load', checkImagesLoaded);
          if (img.complete) checkImagesLoaded(); 
        });
      });
    </script>
</div>
    
<script>
(function(p,r,l,x){
  function v(b,c,k,g,n,d)
  {
    if((-1*b.top)>b.height||b.top>k)
      return;

    d=0;
    b.top<0&&
      (d=-1*b.top/2);

    n=b.top+b.height;
    n>k&&
      (d=-1*(n-k)/2);

    c[l[0]]=(c[l[0]].split(' ')[0]||'50%')+' '+d+'px';
    c[l[1]]!=='scroll'&&
      (c[l[1]]='scroll')
  }

  function w(i)
  {
    for(i=x.length;i--;)
      v(x[i].getBoundingClientRect(),x[i].style,r.innerHeight)
  }

  r=window,l=['backgroundPosition','backgroundAttachment','addEventListener',
    'console'],x=document.querySelectorAll(p);

  r[l[3]]&&(r[l[3]].log('https://github.com/ytiurin/parallax-background.js')||
    r[l[3]].log(x));

  if(x.length){
    r[l[2]]('scroll',w);
    r[l[2]]('resize',w);
    w()
  }
}
('.parallax'))
</script>
